(932, 'dyodoran', 'Belum grand opening , tapi kalau mau mampir udah buka ya @tokosemlidut oleh2 Jogjanya. Mau minta masukan apa aja yang masih perlu di perbaiki\n\nKalau kamu lagi sibuk wisata pesen Aja ke nomer WA ini ya 0818-0789-9499 biar kami anter \n\n#tokosemlidut #tokooleholehjogja #oleholehjogja #Jogja #threads', '2023-07-08T02:59:51.000Z', 'Positif'),
(933, 'dyodoran', 'FAMILY RESTO ANTI MAINSTREAM DENGAN VIEW GUNUNG MERAPI!!\n\nJujur aku baru pertama kali ke tempat ini dan langsung cocok sama vibesnya yang syahdu pol!!\n\nMenunya variatif dengan harga mulai dari 10 ribuan, super terjangkau apalagi buat mahasiswa yang butuh healingg wgwgwg\n\nSelain menu ala carte, kita juga bisa pesan menu by request, nasi box, hampers dan lainnya untuk area Jogja!\n\nAku makan di @yogyankopi . Buka dari jam 8 pagi dan tempatnya family friendly, jadi cocok buat sarapan di sini! Ndang ajak keluargamu lurrr\n\n#familyrestaurant #restokeluarga #kulinerjogja #jogjafood #jogjafoodhunter', '2023-06-30T12:00:00.000Z', 'Positif'),
(934, 'dyodoran', 'Liburan keluarga semakin berkesan dengan nikmatnya berbagai\nmenu otentik sunda di @lalawuhsunda spesialis menu Bakaran dan Pepes Ikan!\nNasi Liwet Spesial Kastrol, Cumi Asin Cabe Gendot, dan Gurameh Pesmol nya BEUH... juara lur!! Pantes jadi menu best seller~\nTempatnya instagramable, kids friendly dan cocok buat kumpul acara besar!\nBuruan agendakan acara keluarga kalian di @lalawuhsunda \n\nInfo & reservasi : 0811-2938-700', '2023-06-28T04:30:00.000Z', 'Positif'),
(935, 'dyodoran', 'Yang nyariin bakso di Jombor sekarang pindah kesini yaaaww\nAda yang langganan juga gak nih lurrr??\n\n#bakso #baksourat #baksosapi #kulinerjogja #dyodoranjogja', '2023-06-27T09:33:57.000Z', 'Positif'),
(936, 'dyodoran', 'Kilas balik kuliner yg sedang viral di Temanggung!!\nAku sama tim kesini udah sekitar 3 tahunan yang lalu\n\nWarung ini sudah berdiri sejak tahun 40an dan pas aku dateng, sudah diolah sama generasi ke-3!!\nSoal rasa gak perlu diraguin lagi lurrr\n\n#throwback #throwbackthursday #kulinertemanggung #kulinerlegendaris #dyodoran', '2023-06-29T09:30:00.000Z', 'Positif'),
(937, 'dyodoran', 'POV BAPACK2 BARU TAS PINK \nDengan seperangkat popok, tisu, botol dot dll \n\nCocok lah ya ? Wgwgwg\n\n#bendyoFamily #newbabyborn #newborn #stroller', '2023-07-01T04:39:47.000Z', 'Netral'),
(938, 'dyodoran', 'Warung ini cuma 10 menitan sebenernya kaloo dari rumahku, tapi baru pertama kalinya aku makan disini!\nGak nyangka ternyata warung in legend wgwgwg tau gitu dari dulu tak samperin\n\n#tongseng #satekambing #kulinerlegendaris #kulinerjogja #dyodoranjogja', '2023-06-24T09:30:35.000Z', 'Positif'),
(939, 'dyodoran', 'BIKIN TEH PAKE MESIN JAHIT??\n\nPertama kalinya aku nemu tempat minum teh yang seunik ini lurrr\nMulai dari bahannya, lokasinya, sampe cara bikinnya!\nAda yang pernah coba?\n\n#teh #tehtelur #kulinermalam #kulinerjogja #dyodoranjogja', '2023-06-25T09:30:00.000Z', 'Positif'),
(940, 'dyodoran', 'Kalo kesehatan mulai ngedrop, jajan jamu jadi pilihan pertama!\nIni tipikal warung jamu g rempahnya lumayan banyak dan hasilnya juga nendang!\nKalian biasanya pesen apa lur?\n\n#jamu #jamutradisional #kulinerjogja #jogjafood #dyodoranjogja', '2023-06-23T09:33:22.000Z', 'Positif'),
(941, 'dyodoran', 'Tebak kira2 besok siapa yang menjadi pemenangnya?\n- Baju Putih\n- Baju kotak2\n- Jaket jeans\n\nTayang hari Jum’at 23 Juni 2023 Jam 19.00 Di Channel YouTube Dyodoran\n\n#lombamakan #mukbang', '2023-06-22T12:53:58.000Z', 'Netral'),
(942, 'dyodoran', 'YANG LAGI VIRAL DI TIKTOK, ROTI SEHAT TANPA KIMIA AKHIRNYA BUKA TOKO!\n\nDi Tiktok lagi trend makan bluder pake susu!\nKalo aku rekomendasiin bluder langganan dari 2019 yang dibuat konsisten tanpa bahan pengawet, jadi lebih sehat!\n\nSelain bluder, di sini juga ada Bomboloni, Cake, Roti Tawar Bebas Gluten, Scone, dan puluhan jenis roti lainnya yang rasanya BEUH… wajib coba sendirii\n\nKalian bisa dapetin DISKON ALL ITEMS 10% dengan repost reels ini ke instastory, tulis kode promo \"DYO2001\" dan tag IG @hikarubakehouse.new dan @bludersusujogja , terus tunjukkin ke kasir dehh\n\nBerlaku cuma sampai tanggal 1 Agustus 2023 lhoo, ndang direpost terus jajan lur!!\n\n#bluder #hikarubakehouse #bludersusujogja #promohikaru #kulinerjogja #jogjafoodhunter', '2023-07-20T09:20:49.000Z', 'Positif'),
(943, 'dyodoran', 'Update @tokosemlidut \nUdah menjelang hari H sambil deg2an\nOiya buat UMKM yang udah ngirim sample ditunggu ya konfirmasinya \n\n#tokosemlidut #oleholehjogja', '2023-06-28T12:35:38.000Z', 'Positif'),
(944, 'dyodoran', 'SEHARI HABIS 1 KWINTAL AYAM?! \n\nini tuh salah satu ayam goreng lokal terkenal di Jogja yang sebelahan langsung sama ayam goreng label M itu lho lurr\nkemaren aku kesini sama Mas Evan @hobbymakan.id dan rasanya BEUH...\nkalian ada yang langganan kesini juga gak lur?\n\n#ayamgoreng #ayamgorengtepung #kulinerjogja #jogjafoodhunter #dyodoranjogja', '2023-06-26T09:30:00.000Z', 'Positif'),
(945, 'dyodoran', 'Spot soto yang satu ini langsung jadi langganan karena sotonya seger dan gorengannya itu lho...\nSelalu hangat!!\nHarganya juga murah, dan buat pecinta baling bisa request soto balungan!\nAda yg tau lokasi soto ini gak? \n\n#sotoayam #kulinerjogja #kulinerjogjamurah #jogjafood #dyodoranjogja', '2023-06-20T12:00:00.000Z', 'Positif'),
(946, 'dyodoran', 'CUMA DI SINI BISA KULINERAN BARENG PAK ERICK TOHIR!! \n\nKapan lagi ikut race terus menikmati berbagai kuliner khas Jogja di 1 tempat bareng Pak @erickthohir kalau bukan di acara Mandiri Jogja Marathon 2023?!\n\nYang bikin makin asyik, kalian bisa dapetin Cashback up to 50% dengan pembayaran via Kartu Kredit, Kartu Debit, dan QRIS Livin\' by Mandiri!\nPromo ini berlaku sampai akhir 30 Juni 2023 lho~\nList merchant bisa kalian cek di bmri.id/promojogja23 yaa\n\nFollow @mandirijogmar & @bankmandiri untuk info selengkapnya dan jumpa di Mandiri Jogja Marathon 2024 lur! \n\n#MajukanEnergiIndonesia #MJM2023', '2023-06-21T09:30:00.000Z', 'Positif'),
(947, 'dyodoran', 'BURGER SOMBONG YANG CUMA BUKA 2X SEMINGGU!!\n\nBun burgernya lembut dan pas digigit bareng saus signaturenya BEUH... semlidutt\nTempatnya juga asik buat ngobrol bareng temen temen!\nNdang dicoba lurr~\n\n#burger #kulinerjogja #dyodoran', '2023-06-19T09:30:00.000Z', 'Positif'),
(948, 'dyodoran', 'DI PROTES‼️\n“Mas mbok borong warung kecil aja” Okay siap langsung di kabulkan\n\nTayang malem ini jam 7 di YouTube Dyodoran \n\nDi tonton ya sambil ninggalin jejak, kalau rame aku lanjutin \n\n#warungklontong', '2023-06-16T05:35:00.000Z', 'Positif'),
(949, 'dyodoran', 'Menurutku ini cocok buat kalian yang suka ngegrill tanpa batasan waktu!\nPudingnya rekomendid bener lurr, semliduttt \n\n#japanesegrill #kulinerjogja #jogjafoodies #jogjafoodhunter #dyodoranjogja', '2023-06-17T09:28:58.000Z', 'Positif'),
(950, 'dyodoran', 'Sebelumnya aku dah beberapa kali makan disini dan cocok!\nYang aku suka disini tuh ada tambahan topping paru dan isian baksonya BEUH!!\nAda yang udah pernah coba??\n\n#kulinerjogja #bakso #baksosapi #kulinerlegendaris #dyodoranjogja', '2023-06-16T12:00:00.000Z', 'Positif'),
