(953, 'dyodoran', 'KULINER SETAN, IBUNYA TAKUT LARIS?!\n\nKilas balik hari ini aku mau ajak kalian main ke daerah Tegal!\nKuliner ini jadi salah satu makanan yang direquest sama Warga CCTV Semlidut buat diliput karenaaa namanya yang unik dan pedesnya menggelegar lurrr\nSebenernya ini cuma tempe orek yang dimasak sama kuah pedes, tapii yang antriii BEUH... luar biasa!!\nAda yang berani makan ini?\n\n#throwback #throwbackthursday #kulinertegal #kulinerlegendaris #dyodoran', '2023-06-15T09:30:00.000Z', 'Positif'),
(954, 'dyodoran', 'Kilas balik momen BORONG KEPALA KAMBING!!\n\nWarga CCTV Tegal mana nih suaranya??\nTegal terkenal akan olahan kepala kambingnya, jadi ya langsung tak mampir~\nWarungnya sudah jualan 3 generasi, jadi rasanya BEUH... terverifikasi semlidut!\n\n#throwback #throwbackthursday #kepalakambing #kulienelegendaris #kulinertegal', '2023-06-22T09:30:04.000Z', 'Positif'),
(955, 'dyodoran', 'SAME KEHABISAN NAPAS!!\n\nGa sengaja, ternyata stranger yg aku tantang adalah seorang ibu yg punya anak umur 3 tahun!\nMenurut kalian udah cukup banyak belum nih ibu mborongnya?\n\n#borong #belanjamurah #belanjagratis', '2023-06-18T09:30:00.000Z', 'Positif'),
(956, 'dyodoran', 'UPDATE TOKO SEMLIDUT\nhari ini akan aku chat 1-1 ya untuk jadwal kurasinya \n\n#TokoSemlidut #OlehOlehJogja', '2023-06-14T04:32:21.000Z', 'Positif'),
(957, 'dyodoran', 'Duluu kuliner ini viral karena jualan ketoprak pake mobil kodok dann jualannya pas depan kuburan kristen terkenal di Jogja!\nJebul wis pindah, makanya aku update disini wgwgwg\nIni tipikal ketoprak yang puedesnya nampol, jadi tak saranin cabenya dikit aja kalo kalian mau tidur dengan tenang yawww\n\n#ketoprak #kulinermalam #kulinerjogja #kulinermalamjogja #dyodoranjogja', '2023-06-13T09:30:00.000Z', 'Positif'),
(958, 'dyodoran', 'AAHHHH akhirnya ada pendatang gelato baru lagi lurrr di Jogjaa!!\nDi lokasinya pas depan Tamansari, jadi pas banget abis panas panasan langsung ngadem disini!!\nSemlidut lezatos kotos kotosss\n\n#gelato #gelatojogja #kulinerjogja #jogjafood #jogjafoodhunter', '2023-06-05T09:30:00.000Z', 'Positif'),
(959, 'dyodoran', 'MENGGILA DI BANDUNG!!!\n\nMain ke Braga, Bandung, rasanya agak kureng kalo gak mampir ke toko satu ini\nBuat para pecinta es krim, menurutku kalian pasti bakal jatuh cinta sama es krim\ncokelatnya!\nJoss tenann semlidut lezatos kotos kotosss\n\n#kulinerbandung #tahilalats #bandungkuliner #bandungfoodies', '2023-06-11T09:30:00.000Z', 'Positif'),
(960, 'dyodoran', 'Rolasaaaannnn sekkkk Lurrrrr', '2023-06-08T04:44:23.000Z', 'Positif'),
(961, 'dyodoran', 'Seperti yang kebanyakan orang tau, Lumpia tuh ikon kulinernya Semarang\nTapii di Jogja juga ada Iho!\nIni pertama kalinya aku makan Lumpia ala Jogja\nSaosnya beda banget sama Lumpia Semarang, tetep joss semlidut lezatos kotos kotos... \n\n#lumpia #lumpiagoreng #kulinerlegendaris #kulinerjogja #dyodoranjogja', '2023-06-06T09:30:00.000Z', 'Positif'),
(962, 'dyodoran', 'nambah lagiii kuliner fancy di Jogja!\nmenurutku kalo untuk self reward sih ini sudah sangat cukup yaww\nasal jangan keseringan lurrr ben gak cepet kempes dompetmu\n\nbtw Warga CCTV Semlidut udah ada yang kesini belum?\n\n#kulinerjogja #jogjafood #jogjafoodhunter #cafejogja #dyodoranjogja', '2023-06-04T09:30:00.000Z', 'Positif'),
(963, 'dyodoran', 'PERTAMA KALI IKUT KELAS BIKIN BAKPIA!!\n\nMeskipun udah lama tinggal di Jogja dan sering nyemil Bakpia, ini pertama kalinya aku tau ada kelas bikin Bakpia!\n\nSelesai bikin Bakpia lanjut kita belanja~ Tempatnya luas pol! Fasilitasnya lengkap, ada masjid dan parkirannya juga luas. Kapasitas area restonya bisa untuk 1000pax! \n\nMenurutku tempatnya oke sih buat tujuan wisata terakhir karena ini adalah tempat oleh-oleh terlengkap dan terbesar di Jogja, apalagi bakal ada mini zoo disini \n\nInfo kelas Bakpia lebih lanjut langsung follow @ibarbopark !\n\n#oleholeh #oleholehjogja #jogjafoodhunter #jogjafooddestinations #ibarbopark', '2023-06-12T09:33:36.000Z', 'Positif'),
(964, 'dyodoran', 'salah satu jajanan favorit soalnyaa lumayan buat ngganjel perut pas lagi moving dari warung ke warung wgwgwgwg\nkalo kalian lebih suka cimol, kentang, atau ubi lur?\n\n#streetfood #kentanggoreng #dyodoran', '2023-06-10T09:30:00.000Z', 'Positif'),
(965, 'dyodoran', 'Semangat hari Senin Om Tante semuaaa ‍ \n\n#bendyofamily', '2023-06-12T03:04:09.000Z', 'Positif'),
(966, 'dyodoran', 'Agak kaget sih pas tau nama warung ini persis kayak warung bebek terkenal di Surabaya.\nArek Suroboyo, pie kii rasane podo ta gakk??\n\n#bebeksurabaya #nasibebek #kulinerjogja #kulinerjogjamurah #dyodoranjogja', '2023-06-03T09:30:00.000Z', 'Positif'),
(967, 'dyodoran', 'Menurutku, soto tuh satu kuliner yang cocok di segala suasana\nDimakan pagi sing malem cocok.. pas lagi panas atau hujan makin nikmat!\nNah kali ini aku mbahas soto legendaris yang terkenal di Jogja dan ada beberapa cabangnya!\nTapi kira kira mana yang asli ya lur?\n\n#soto #sotosapi #kulinerlegendaris #kulinerjogja #dyodoranjogja', '2023-06-02T09:30:00.000Z', 'Positif'),
(968, 'dyodoran', 'Warga CCTV Semlidut area Mbantul pasti gak asing sama kuliner ini!\nBuka dari tahun 50-an, dan antriannya ngeri lurrr..\nKalo ada cabangnya di tengah kota, aku pasti bakal sering pesen!!\n\n#tongseng #tongsengayam #kulinerlegendaris #kulinerjogja #dyodoranjogja', '2023-05-30T09:30:00.000Z', 'Positif'),
(969, 'dyodoran', 'Kilas balik kali ini aku mau bawa kalian ke Bandung!\n\nKuliner legendaris yang dijual dari tahun 1980.\nAwalnya jualan bakso, terus terpikirlah buat bikin menu iniii\nUniknya disini ada 2 versi lur, goreng & kuah!\nAda yang tau gak nih aku makan dimana? \n\n#throwback #throwbackthursday #kulinerbandung #kulinerbandungjuara #batagor', '2023-06-01T12:00:00.000Z', 'Positif'),
(970, 'dyodoran', 'Hehehehe…\nAlhamdulillah \n\n#newborn #newbornbaby #BenDyoFamily #masKenzie', '2023-05-31T04:30:07.000Z', 'Positif'),
(971, 'psnovi', 'Teh tubruk kah ini namanya?!\nBaru tau sih ini namanya produk Angkringan.. nah kemarin Beli Di toko dari jogja, dikirim dari sekitaran jogja ini.. teh nya Di mix satu, wanginya Jadi nge blend, enak ada pait dan wangi melati  Besok kita coba Makanan daerah mana lagi nih?!\n\n#PSNovi', '2023-06-02T05:05:08.000Z', 'Positif'),
(972, 'dyodoran', 'Iga panggang yang lagi rameee di Jakartaa!!\nIni gokil sih, soalnya sehari tuh bisa sampe buka 3 sesi dan 1,5 jam aja langsung habis!\nWarga CCTV Semlidut udah pada kesini belum??\n\n#igapanggang #kulinerjakarta #kulinerjakartaselatan #igabakar #dyodoranjakarta', '2023-05-27T09:30:00.000Z', 'Positif'),
(973, 'dyodoran', 'WARTEG ARTSY BARU DI JALAN KABUPATEN!!\n\nUntuk masuknya memang agak mblusuk siih, tapi makanannya lurr… semlidut!!\n\nMenurutku, kalian harus coba ikan asap, cumi hitam plus sambel ndeso nya. Untuk dessert-nya jangan kelewat nyobain flan dan es kuwut.\n\nKalo masih ada, garang asemnya juga ndang disikat!!\n\nAku makan di @vindotyskitchen . Tempatnya homey, serasa makan di rumah!\n\n‌\n\n#nostalgiarasa #wartegjogja #hiddengemjogja #jogjafoodhunter #dyodoranjogja', '2023-05-26T09:30:00.000Z', 'Positif'),
(974, 'dyodoran', 'LARIS MANIS TANJUNG KIMPUL!!\n\nKilas balik hari ini mau ngebahas salah satu kuliner legendaris Ayam Adun Pelabuhan Bu Mani di Gresik!\n\nBuka dari jam 5 pagi, jam 8 udah abis lurr yaampun untung aku masih kedapetan!\n\nKomen dong kalo kalian pernah kesini!\n\n#throwback #throwbackthursday #kulinerlegendaris #kulinergresik #dyodoran', '2023-05-25T09:30:00.000Z', 'Positif'),
(975, 'dyodoran', 'Kalo kalian mau nyobain kuliner yg agak beda, coba deh pesen menu spesial di tempat ini!\nSoalnya aku bahkan gak nemuin menu ini di kota asalnya lurrr wgwgwg\n\n#bakmi #bakmijawa #kulinerjogja #jogjafoodhunter #dyodoranjogja', '2023-06-09T09:30:00.000Z', 'Positif'),
(976, 'dyodoran', 'Aku punya rekomendasi buat kalian yang mau kulineran di Solo dengan waktu terbatas!!\nNext coba kuliner apa lagi ya?\n\n#kulinersolo #kulinersoloenak #kulinersolomurah', '2023-05-29T09:30:08.000Z', 'Positif'),
(977, 'dyodoran', 'Cuma jualan nasi + telur bisa dapet omset 7juta lurrr sebulannn wgwgwg\nKalian wis do nyoba belum nihh??\n\n#nasitelur #kulinerviral #kulinerjogja #kulinerjogjamurah #dyodoranjogja', '2023-05-31T09:30:00.000Z', 'Positif'),
(978, 'dyodoran', 'Bismillah minta doanya ya semuanya \nKalau yg mau nonton fullnya bisa di Channel yuhub Dyodoran \n\n#kulinerjogja #Rotibakar #jogja', '2023-05-25T13:06:48.000Z', 'Positif'),
(979, 'dyodoran', 'Auto belanja banyak sih karna perlengkapan bayi di @babyzania.jogja lucu-lucu bangetttt! \n\nMulai dari perlengkapan bayi, kepentingan toiletris sampai spa untuk bayi dan anak juga ada lho! Bisa kalian cek juga di marketplace Baby Zania Jogja\n\nNah ada info promo nih:\n- Pembelian 500k free sepatu (selama persediaan masih ada)\n- KHUSUS MEMBER pembelian 100k mendapatkan poin, yang bisa ditukarkan dengan berbagaI jenis hadiah\n\nDi sini FREE pembuatan member setiap hari SELASA dengan min. belanja 200k atau 500k dengan biaya admin 10k.\n\nKeuntungan memiliki member bisa mendapatkan disc 5% - 10% per item, dan dapet poin yg bisa ditukarkan sama berbagai macam kebutuhan baby. Buruan bikin member bisa makin puas belanjanya! \n\nWA : 0877-7086-3636\nTelf : ( 0274 ) 487836', '2023-05-22T09:30:00.000Z', 'Positif'),
(980, 'dyodoran', 'RAMEN HIDDEN GEM YANG DISKON SETIAP HARI!! \n\nSebelumnya aku pernah makan disini dan terverifikasi semlidut\nEh terus ada menu baru, ya langsung too tak samperinn\n\nAda 3 menu baru yang wajib kalian coba: Izumi Spesial Tamtam, Samurai Komakura, dan Corn Ribs sebagai side dishnya\nKuah ramennya dimasak sampe 8 jam lurr, menghasilkan rasa yang… HADEEHH, kalian cobain sendiri deh wgwgwg\n\nLokasinya ada di Jl. Sidokabul No.8, Sorosutan Umbulharjo\nBuka dari jam 11.00-21.00, diskon 15% setiap harinya!\nInfo lebih lanjut langsung cek @roka.id \n\n‌#ramen #ramenhalal #ramenjogja #kulinerjogja #dyodoranjogja', '2023-05-24T09:30:00.000Z', 'Positif'),
(981, 'dyodoran', '5000 UDAH DAPET PAKET KOMPLIT?!\n\nmahasiswa wajib merapat, aku nemu warung ramesan murah ramah di kantong!\nwarung ini dah buka dari tahun 1970an dengan beberap menu berbeda tiap harinya\nkalian ada yang suka kesini gak lurrr?\n\n#kulinerjogja #kulinerjogjamurah #kulinermahasiswa #jogjafoodhunter #dyodoranjogja', '2023-05-21T09:30:00.000Z', 'Positif'),
(982, 'dyodoran', 'HIDDEN GEM FAMILY RESTO DI RINGROAD TIMUR!!\n\nMenurutku ini tempat yang pas buat recharge energi karena lokasinya ga jauh, cuma 5 menit dari Jogja Expo Center!\n\nMenunya beragam dan menurutku yang wajib kalian coba tuh: Empal Gentong, Bakmie Jawa Goreng sama Ayam Kampung Bakarnya! Terverifikasi semlidut lurr\n\nGurame Bakarnya juga rekomendid buat disantap bareng keluarga\n\nTempatnya juga sejuk, parkirnya luas, fasilitasnya lengkap dan ada wahana bermain anak!\n\nAku makan di @pawonjati_jogja by Nusantara Catering\n\n‌#familyresto #familyrestojogja #pawonjati #kulinerjogja #jogjafoodies', '2023-05-20T09:30:00.000Z', 'Positif'),
(983, 'dyodoran', 'Maaf ya aku batasi karena raknya juga terbatas, Aku tunggu pendaftarannya sampai tgl 30 Mei 2023 \n\nLinknya di copy ke browser:\nhttps://bit.ly/DaftarUMKMTokoSemlidut\n\n#tokosemlidut #oleholehjogja', '2023-05-21T03:26:37.000Z', 'Positif'),
(984, 'dyodoran', 'MUKBANG KEPALA KAMBING UTUH DI JOGJA SELATAN\n\nAda warung sate kambing baru di Selatan yang punya nasi FREE REFILL dan KERUPUK GRATIS!!\n\nFYI, biasanya sate klatak itu disajikan bareng kuah gulai yang light, makanya pas makan sate klatak kuah tongseng di @satekambingmbahdjoyo tuh sensasi beda! Semlidut lezatos kotos kotosss\n\nTempatnya nyaman, parkiran luas dan bisa menampung sampai 40 orang! Cocok banget ki lurr buat kumpul bareng temen-temen atau keluarga~\n\nInfo pemesanan bisa langsung chat via Whatsapp +62 821-3480-4034\n\n#kepalakambing #satekambing #sateklatak #satekambingmbahdjoyo #kulinerjogja', '2023-05-17T09:27:13.000Z', 'Positif'),
(985, 'dyodoran', 'Jajan di pasar tuh jadi salah satu kegiatan healing\ntipis tipis, soalnya seru aja gituu ngeliat\ninteraksinyaa\nAda yang saman gak? \n\n#kulinerjogja #kulinerjogjamurah #dyodoranjogja #jogjafoodhunter #jogjaistimewa', '2023-05-19T09:30:00.000Z', 'Positif'),
(986, 'dyodoran', 'Bismillah biar kayak yg lain punya usaha \nTebak aku mau buka apa?\n3 orang yg bener aku kirim masing2 300.000', '2023-05-16T09:00:00.000Z', 'Positif'),
(987, 'dyodoran', 'INTIP DAPUR TRADISIONAL GUDEG OTENTIK!\n\nIni salah satu top brand gudeg dengan rasa manis khas jogjaan\n\nUniknya, Gudeg Yu Djum 167 mengeluarkan Gudeg Frozen tanpa pengawet yang tahan sampe 3 bulan!\n\nSecara rasa ga akan berubah dan tetap aman buat dikirim ke berbagai kota\n\nSelain itu ada gudeg kaleng ready to eat, bisa langsung dimakan atau mau dipanasin bebass\n\nKalo aku sih langsung makan aja ya, wis keburu ngiler lurrr wgwgwg\n\nCatet ya, Gudeg Frozen Yu Djum 167, bukan yang lain!\n\n#gudegyudjum167 #gudegyudjum #gudegjogja #gudegfrozen #gudegkaleng', '2023-05-15T04:26:34.000Z', 'Positif'),
(988, 'dyodoran', 'PERTAMA KALI DATENG KE PESTA MAKAN NASI GORENG TERBESAR!!\n‌\nGak cuma nasi goreng yaa, berbagai menu khas nusantara ada disini!\nMakin seru karena ada Live Cooking dari @willgoz \nPesta Kuliner Sedaap bakal ada lagi di Bandung, 27 Mei 2023\nTiketnya bisa langsung beli on the spot ya lurr\nInfo lebih lanjut langsung follow @kecapsedaapid\n\n#PestaKulinerSedaap #NasiGorengPilihanSedaap #TastExploration', '2023-05-15T09:30:00.000Z', 'Negatif'),
(989, 'dyodoran', 'Kilas balik kota ke 59, Gresik!!\n\nAku inget, dari luar warungnya aja sudah tercium wangi masakan yang menggoda iman!\n\nPas makanannya dateng, kaget lurr ndelok porsine sak gedabyah!\n\nAda yang tau gak nihh aku makan di warung manaa?\n\n#throwback #throwbackthursday #gresik #gresikhits #gresikkuliner #kulinergresik', '2023-05-18T09:37:12.000Z', 'Negatif'),
(990, 'dyodoran', 'Ini tuh satu satunya tempat yang jual Bakso CepMek alias Cepet Mekar HAHAHAHA\nAgak kesel denger namanya, tapi rasanya BEUH... mantap!!\nTapi tetep, yang paling favorit ya bakso uratnya lurrr\nWarga Bandung udah pada nyobain belum nih?\n\n#baksobandung #kulinerbandung #kulinerbandungjuara #baksotjaphaji #bandungfoodies', '2023-05-23T09:30:00.000Z', 'Negatif'),
(991, 'dyodoran', 'Ini adalah salah satu kuliner yang wajib disamperin kalo lagi main ke Bandung!\n\nDengan title \"Sensasi Cita Rasa Nasi Goreng Sang Legend\", rasanya BEUH.. semlidut!\nMana porsinya jumbo lagi, jadi makin puass wgwgwg \n\nKalian ada yang langganan kesini juga ga lur?\n\n#throwback #throwbackthursday #kulinerbandung #kulinerlegendaris', '2023-05-11T09:27:10.000Z', 'Negatif'),
(992, 'dyodoran', 'Bismillah \nUdah mulai seminggu sekali kontrolnya ‍\n\n#bapakbapaksiaga #babynewborn #ibuhamil', '2023-05-13T04:05:28.000Z', 'Negatif'),
(993, 'dyodoran', 'BIKIN IDE MINUMAN BISA DAPET KESEMPATAN MENANGIN VESPA ATAU IPHONE 14 PRO MAX??\n\nKalian ga salah baca lurrr\n\n#Coffeemezation dari @starbucks.indonesia balik lagi nih!\n\nDengan daftarin ide minuman andalan kalian di coffeemezation.com, kalian berkesempatan buat menangin Vespa Piaggio, iPhone 14 Pro Max dan jutaan hadiah lainnya!\n\nLangsung submit ide minuman kalian maksimal BESOK! tanggal 14 Mei 2023 buat diundi jadi finalist untuk menangin hadiah total ratusan juta rupiahnya!\n\nInfo lengkap langsung cek postingan @starbucksindonesia ya\n\n#Coffeemezation #StarbucksIndonesia #iceAmericano #coffeecompetition', '2023-05-12T12:00:00.000Z', 'Negatif'),
(994, 'dyodoran', 'street food yang lagi viral di Jogja!!\nhayooo, yang kemaren pada liburan ke Jogja wis mampir rene durung??\n\n#kulinerjogja #jogjafood #jogjafoodhunter #jogjafoodies #gulesatelitjogja', '2023-05-07T09:30:00.000Z', 'Negatif'),
(995, 'dyodoran', 'Yang lagi ramere di Pasmod Bintaro!!\nNasinya spesialnya karena dibungkus daun pisang, jadi lebih wangii\nSemlidut lezatos kotos kotoss\n\nKalian ada yg suka kesini juga gak?\n\n#kulinerbintaro #kulinertangsel #bintarofoodies #ayamkampung #dyodoranbintaro', '2023-05-13T09:30:00.000Z', 'Negatif'),
(996, 'dyodoran', 'SPESIALIS GULE JEROAN SEJAK 1945!\nJadi Pasar Godean tu lagi direnovasi dan makan waktu sekitar 1,5 tahun\nNah untungnyaa, Warung Sate Pak Klimkn gak pindah karena sudah punya bangunan sendiri!\nKalian wis do nyobo rung lurrr??\n\n#satekambing #tongseng #kulinerjogja #kulinerlegendaris #dyodoranjogja', '2023-05-09T09:30:00.000Z', 'Negatif'),
(997, 'dyodoran', 'sebenernya dah lewat tempat in beberapa kali atpi belum sempet mampirr\nsampe akhirnyaaa kena racun dari temenkuu wgwgwg\nmind blowing ya lur, singkong goreng dikasi truffle oil \n\n#kulinerjogja #restojogja #jogjafoodhunter #jogjafood #dyodoranjogja', '2023-06-07T09:30:00.000Z', 'Negatif'),
(998, 'dyodoran', 'Jogja punya salah satu warung sop buntut yang semlidutt dan ini dia tempatnya!\nMulai usaha tahun 1985, awalnya sempet coba coba jualan makanan yg lain sampe akhirnya memutuskan jual sop buntut dan hasilnya WOW bisa sampe berangkat haji lurr\nKalian ada yg langganan disini juga gak?\n\n#sopbuntut #sopiga #kulinerlegendaris #kulinerjogja #jogjafoodhunter', '2023-05-08T09:30:00.000Z', 'Negatif'),
(999, 'dyodoran', 'SAMPE SUSAH MAKANNYA!! \n\nAku direkomendasiin kuliner ini sama salah\nWarga CCTV Semlidut \nLangsunglah meluncur ke selatan Jogja dan ternyataaa BEUH.... porsine ngeri lurrr\nAsik banget nii kalo makan bareng temen temenn\n\n#mieayam #mieayambalungan #kulinerjogjamurah #kulinerjogja #dyodoranjogja', '2023-05-10T09:30:00.000Z', 'Negatif'),
(1000, 'dyodoran', 'Kilas balik ES LONTRONG!\n\nAku main ke kedai es ini 2 tahun yang lalu pas lagi syuting kuliner legendaris di Tegal.\nKedai es ini sudah ada sejak tahun 80an, dengan menu es berisi kacang hijau, agar-agar, santan, gula dan es gosrok yang segununggg \nHarga per porsinya waktu itu sih cuma 5000 yaa, kalo ada info update harga boleh dong lurrr komen di bawaah \n\n#throwback #throwbackthursday #kulinertegal #eslontrong #kulinerlegendaris #dyodoran', '2023-06-08T09:30:00.000Z', 'Negatif');
